import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      friends: [
        {
          name: 'trash1',
          i: 0,
        },
        {
          name: 'trash2',
          i: 1,
        },
        {
          name: 'trash3',
          i: 2,
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        {this.state.friends.map(frnd => {
          return <h1 key={frnd.i}>{frnd.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
